    [],nt"revision_timestamp": "2015-09-27T03:00:58.278134",nt"name": "2010-oregon-department-of-geology-and-mineral-industries-dogami-lidar-mt-shasta-study-areac340c",nt"isopen":
    false,nt"url": null,nt"notes": "The Oregon Department of Geology and Mineral
    Industries (DOGAMI) contracted with Watershed Sciences, Inc. to collect high resolution
    topographic LiDAR data for multiple areas within the State of Oregon. The areas
    for LiDAR collection have been designed as part of a collaborative effort of state,
    federal, and local agencies in order to meet a wide range of project goals. This
    LiDAR data set was collected from July 5 through September 2, 2010 and encompasses
    the area around Mt. Shasta in portions of Siskiyou and Shasta counties in California.
    This data set consists of bare earth and unclassified points. The average pulse
    density is 10.18 pulses per square meter over terrestrial surfaces. The area of
    interest (AOI) totals 465 square miles (297,368 acres) and the total area flown
    (TAF) covers 471 square miles (301,454 acres). The TAF acreage is greater than the
    original AOI acreage due to buffering and flight planning optimization. This metadata
    record reflects all the data and cumulative statistics for the overall lidar survey.
    In some areas of heavy vegetation or forest cover, there may be relatively few ground
    points in the LiDAR data. Elevation values for open water surfaces are not valid
    elevation values because few LiDAR points are returned from water surfaces. LiDAR
    intensity values were also collected.",nt"license_title": null,nt"extras":
